import clip from '/dsp/softclip/index.js'
import arp from '/dsp/arp.js'
import envelope from '/dsp/envelope/index.js'

export default t => {
  var kick =
    + sin(t, 19.5) * arp(t, 1/4, 37, 31, 13)
    + (arp(t, 1/4, 38.5, 48, 40)
    + arp(t, 1/4, 35, 49, 40))
    * envelope(t, 1/4, 42, 42, 20) * 1
  kick = clip(kick, 1)
  return kick * .8
}","controlEditor":{"id":"5napq","title":"untitled-17d174"}}

editor_650577:
{"id":"650577","title":"untitled-650577","value":"export default async (context, thres = .05, amt = .12) => {
  let prev = 0.0, next = 0.0, diff = 0.0
  return t => {
    next = t.input
    diff = next - prev
    if (Math.abs(diff) > thres) {
      prev += diff * amt
    } else {
      prev = next
    }
    return prev
  }
}
","controlEditor":{"id":"5napq","title":"untitled-17d174"}}

