{"id":"daa4fa","title":"untitled-daa4fa","value":"export default async (context, d = 1, s = 32) => {
  const bar = context.lengths.bar
  const add = []
  for (let x = 0; x < 10000; x++) {
    add.push((((Math.random() * s | 0)/s) * bar) | 0)
  }
  let i = 0
  return t => t.output[0][((i++ % Math.floor(bar/d)) +
    (add[(t*1) % add.length | 0])
  ) % bar]
}
","controlEditor":{"id":"5napq","title":"untitled-17d174"}}

editor_f40b68:
{"id":"f40b68","title":"untitled-f40b68","value":"export default async (context, thres = .24, w = 200, release = 15000) => {
  let zeroMark = 0
  let aboveThres = false
  let max = 0.0
  let sum = 0.0
  let avg = 0.0
  let x = 0
  let i = 0
  let data
  return t => {
    zeroMark = 0
    data = t.output[0]
    for (x = 0; x < data.length; x += w) {
      if (x < zeroMark) continue

      sum = 0
      for (i = x; i < x+w; i++) {
        sum += Math.abs(data[i])
      }
      avg = Math.min(1, (sum / w))

      // max = Math.abs(Math.max(...data.subarray(x, x+w)))
      if (avg > thres && !aboveThres) {
        aboveThres = true
        data.fill(0, zeroMark, x-w)
      }
      if (avg < thres && aboveThres) {
        aboveThres = false
        zeroMark = x+w+release
      }
    }
    if (avg < thres && !aboveThres) {
      data.fill(0, zeroMark, data.length)
    }
  }
}
","controlEditor":{"id":"5napq","title":"untitled-17d174"}}

